import React from "react";

const Comment = (props) => {

    return (
        <div className="container">
            <button className="back-button" onClick={() => props.history.push("/Stat")}>Back</button>
                <h1>
                    캐릭터들로 보는<br/>나의 성격 유형 테스트
                </h1>
                <p>나와 닮은 캐릭터는 누구일까?</p>
                <button
                    className="start-button"
                    onClick={() => props.history.push("/QnA")}
                >
                    START
                </button>
        </div>
);
}

export default Comment;
